package conditional;

public class Quiz8 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int 점수 = 65;
		int 수 = 점수/10;
		
		switch(수) {
		case 9 :
			System.out.println("수");
		case 8 :
			System.out.println("우");
		case 7 :
			System.out.println("양");
		default :
			System.out.println("미");
		}
	}

}
